import React from 'react';
import { Link } from 'react-router-dom';

class Footer extends React.Component{
    render() {
        return (
            <div>
                <div className="mainContentbg">
                    <div className="text-center text-white">
                        <Link></Link>
                    </div>
                </div>
            </div>
        )
    }
}
export default Footer;
